                  .fontColor('#4bb0c4')
                Text(this.playState.author)
                  .fontSize(18)
                  .fontColor('#4bb0c4')
              }
              .translate({
                x: this.shakenX,
                y:this.shakenY
              })
              .layoutWeight(1)
              .justifyContent(FlexAlign.Center)
              .zIndex(1)
              // 第二个
              Column({ space: 8 }) {
                Text(this.playState.name)
                  .fontSize(28)
                  .fontWeight(FontWeight.Bold)
                  .fontColor('#ec5c87')
                Text(this.playState.author)
                  .fontSize(18)
                  .fontColor('#ec5c87')
              }
              .layoutWeight(1)
              .justifyContent(FlexAlign.Center)
              .zIndex(2)
              // 第三个
              Column({ space: 8 }) {
                Text(this.playState.name)
                  .fontSize(28)
                  .fontWeight(FontWeight.Bold)
                  .fontColor(Color.White)
                Text(this.playState.author)
                  .fontSize(18)
                  .fontColor(Color.White)
              }
              .layoutWeight(1)
              .justifyContent(FlexAlign.Center)
