        }
        .onClick(() => {
          this.panelHeight = '0%'
        })
        // 列表
        Column() {
          Column() {

          }
          .width('100%')
          .layoutWeight(1)
          .onClick(() => {
            this.panelHeight = '0%'
          })
          Column() {
            Row({space: 10}) {
              Image($r('app.media.ic_play'))
                .width(20)
                .aspectRatio(1)
              Text('播放列表')
                .fontColor('white')
              Text(`(${this.playState.playList?.length})`)
                .fontColor('white')
            }
            .width('100%')
            // 列表
            List() {
              ForEach(this.playState.playList, (item:songItemType, index) => {
                ListItem() {
                  Row({space:10}) {
                    Text(String(index+1))
                      .fontColor('rgb(99, 97, 98)')
                      Column() {
                        Text(item.name)
                          .fontColor(this.playState.playIndex === index?'rgb(254, 81, 134)':'rgb(99, 97, 98)')
                        Text(item.author)
                          .fontColor(this.playState.playIndex === index?'rgb(254, 81, 134)':'rgb(99, 97, 98)')
                      }
                      .onClick(() => {
                        AVPlayerClass.singlePlay(item)
                      })
                      .alignItems(HorizontalAlign.Start)
                      .layoutWeight(1)



                    Image($r('app.media.ic_more'))
                      .width(20)
                      .fillColor('rgb(99, 97, 98)')
                  }
                  .width('100%')
                  .height(60)

                }

              })
            }
          }
          .padding(20)
          .backgroundColor('rgb(53, 51, 52)')
          .width('100%')

        }
        .height(this.panelHeight)
        .animation({
          duration:300
        })


      }
      .backgroundColor(Color.Transparent)
    }
    .width('100%')
    .height('100%')
    .backgroundColor(Color.Transparent)
  }
}

