                  .fillColor(Color.White)
                  .width(30)
                  .onClick(()=>{
                    AVPlayerClass.next()
                  })
                // 播放列表
                Image($r('app.media.ic_song_list'))
                  .fillColor(Color.White)
                  .width(30)
                  .onClick(() =>{
                    this.panelHeight = '50%'
                  })
              }
              .width('100%')
              .padding({
                bottom: 24
              })
              .justifyContent(FlexAlign.SpaceAround)
            }
            .width('100%')

          }
          .layoutWeight(1)
          .width('100%')
        }
        .onClick(() => {
          this.panelHeight = '0%'
        })
        // 列表
        Column() {
          Column() {

