import { momentList } from '../constants/musicsj'
import { momentListType } from '../models/music'

@Component
struct Moment {
  build() {
    Column() {
      Row() {
        Text('互动广场')
          .fontColor('#eaeaec')
      }
      .padding(24)
      .width('100%')
      Row() {
        List({ space: 12 }) {
          ForEach(momentList, (item: momentListType) => {
            ListItem() {
              Row({ space: 12 }) {
                Row() {
                  Image(item.avatar)
                    .borderRadius(40)
                    .width(40)
                }

                Column({ space: 12 }) {
                  // 作者
                  Text(item.author)
                    .fontColor('#e9e9e7')
                  // 内容
                  Text(item.content)
                    .fontColor('#aaa9af')
                    .fontSize(12)
                  // 音乐卡片
                  Row() {
                    Image(item.song.img)
                      .width(60)
                      .aspectRatio(1)
                    Column({ space: 10 }) {
                      Text(item.song.name)
                        .fontColor('#f4f4f6')
                        .fontSize(12)
                      Text(item.song.author)
                        .fontColor('#a8a8ad')
                        .fontSize(10)
                    }
                    .layoutWeight(1)
                    .height(60)
                    .alignItems(HorizontalAlign.Start)
                    .justifyContent(FlexAlign.SpaceBetween)
                    .padding(12)
                    Image($r("app.media.ic_single_play"))
                      .width(20)
                      .fillColor('#ececec')
                      .margin({ right: 12 })
                  }
                  .backgroundColor('#46474c')
                  .width('100%')
                  .borderRadius(8)
                  .clip(true)
                  Row({ space: 20 }) {
                    Row() {
                      Image($r('app.media.ic_share'))
                        .width(20)
                        .fillColor('#c9c8cd')
                      Text('分享')
                        .fontColor('#9e9da2')
                        .fontSize(12)
                        .margin({ left: 4 })
                    }

                    Row() {
                      Image($r('app.media.ic_comment_o'))
                        .width(20)
                        .fillColor('#c9c8cd')
                      Text(item.comment.toString())
                        .fontColor('#9e9da2')
                        .fontSize(12)
                        .margin({ left: 4 })
                    }

                    Row() {
                      Image($r('app.media.ic_like'))
                        .width(20)
                        .fillColor('#c9c8cd')
                      Text(item.like.toString())
                        .fontColor('#9e9da2')
                        .fontSize(12)
                        .margin({ left: 4 })
                    }
                  }
                }
                .layoutWeight(1)
                .alignItems(HorizontalAlign.Start)
              }
              .alignItems(VerticalAlign.Top)
              .padding({
                top: 24,
                bottom: 24
              })
              .borderWidth({
                bottom: 1
              })
              .borderColor('#292931')
            }
          })
          ListItem() {
            Row() {
              Text('我是有底线的~')
                .fontColor(Color.Gray)
            }
            .width('100%')
            .justifyContent(FlexAlign.Center)
            .padding(16)
          }
        }
        .width('100%')
        .height('100%')
        .padding({ right: 32, left: 16})

      }
      .layoutWeight(1)
    }
    .width('100%')
    .height('100%')
  }
}

